import React from "react";
import Header from "./Header";
import HomeScreen from "../screens/HomeScreen";
import Footer from "./Footer";

const Home = () => {
  return (
    <>
      <Header />
      <HomeScreen />
      <Footer />
    </>
  );
};

export default Home;
